function App(props) {
  return (
    <div >
      <NavBar />
      <Grid container spacing={0}>
        <Grid item xs={6}>
        <Paper>
          <ToDo />
          </Paper>
        </Grid>
        <Grid item xs={6}>
        <Paper>
          <ToDo />
          </Paper>
        </Grid>
      </Grid>
    </div>
  );
}


export default (App);
